// src/components/ThoughtNode.js
import React from 'react';
import './ThoughtNode.css';

const ThoughtNode = ({ thought, onSelect }) => {
  return (
    <div
      className={`thought-node ${thought.status === 'Проблема' ? 'problem' : 'solution'}`}
      onClick={() => onSelect(thought)}
    >
      {thought.title}
    </div>
  );
};

export default ThoughtNode;
